import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import {Link} from 'react-router-dom';
import {Jumbotron} from 'react-bootstrap';
import {Grid} from 'react-bootstrap';
import BootstrapTable from 'react-bootstrap-table-next';
import './Schedule.css'
export default class Schedule extends Component{
    state = {
        products: [
          {
            busNum: 1,
            from: 'Lhr',
            to: 'Rwp',
            arrival: '15:00',
            departure:'11:00',
            fare: '1500'
          },
          {
            busNum: 2,
            from: 'Lhr',
            to: 'Fsb',
            arrival: '13:00',
            departure:'10:30',
            fare: '800'
          },
          {
            busNum: 3,
            from: 'Rwp',
            to: 'Multan',
            arrival: '20:00',
            departure:'12:30',
            fare: '2500'
          },
          {
            busNum: 4,
            from: 'Rwp',
            to: 'Bwp',
            arrival: '22:00',
            departure:'10:30',
            fare: '2500'
          }
        ],

        columns: [{
          dataField: 'busNum',
          text: 'Bus Number'
        },

        {
            dataField: 'from',
            text: 'From'
          },

          {
            dataField: 'to',
            text: 'To'
          },

          {
            dataField: 'arrival',
            text: 'Arrival Time'
          },
          {
            dataField: 'departure',
            text: 'Departure Time'
          },
         {
          dataField: 'fare',
          text: 'Fare',
          sort: true
        }]
      } 
      
      render() {
        return (
          <div style={{ padding: "20px" }}>
            <h1 className="h2">Buses Schedule</h1>
            <BootstrapTable keyField="busNum" data={products} columns={columns} />
          </div>
        );

      }
    }
